def can_form_ticks(n, m, k, grid):
    dp = [[False for _ in range(m)] for _ in range(n)]
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '*':
                (p, q) = (i, j)
                (r, s) = (i, j)
                tot = 0
                while True:
                    p -= 1
                    q -= 1
                    r -= 1
                    s += 1
                    if p >= 0 and r >= 0 and (q >= 0) and (s < m) and (grid[p][q] == '*') and (grid[r][s] == '*'):
                        tot += 1
                    else:
                        break
                if tot >= k:
                    dp[i][j] = True
                    (p, q) = (i, j)
                    (r, s) = (i, j)
                    for _ in range(tot):
                        p -= 1
                        q -= 1
                        r -= 1
                        s += 1
                        dp[p][q] = True
                        dp[r][s] = True
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '*' and dp[i][j] == False:
                return False
    return False

